from pylab import *
import math
from numpy import *

class Ball:
  def __init__(self, mass, radius):
    self.mass = mass
    self.radius = radius

  def getM1(self):
    return self.mass

  def getR1(self):
    return self.radius

  def getI1(self):
    return (2.0 / 5.0 * self.mass * (self.radius) ** 2)

class Path:
  def __init__(self, v0, theta):
    self.g = 9.8
    self.v0 = v0
    self.theta = theta
    self.v0x = self.v0 * np.cos(self.theta * np.pi / 180.0)
    self.v0y = self.v0 * np.sin(self.theta * np.pi / 180.0)

  def getX(self, t):
    self.t = t
    return self.v0x * self.t

  def getY(self, t):
    self.t = t
    return (self.v0y * self.t) - (0.5 * self.g * t**2)

class Baton(Ball, Path):
  def __init__(self, mass, radius, v0, theta, L1, w1):
    Ball.__init__(self, mass, radius)
    Path.__init__(self, v0, theta)
    self.L = L1
    self.w = w1

  def getM(self):
    return 2.0 * self.getM1()

  def getI(self):
    return (2 * self.getI1() + 0.5 * self.getM() * self.L**2)

  def getXa(self, t):
    xa = self.getX(t) + 0.5 * self.L * np.cos(self.w * t)
    return xa

  def getYa(self, t):
    ya = self.getY(t) + 0.5 * self.L * np.sin(self.w * t)
    return ya

  def getXb(self, t):
    return self.getX(t) - 0.5 * self.L * np.cos(self.w * t)

  def getYb(self, t):
    return self.getY(t) - 0.5 * self.L * np.sin(self.w * t)

  def position(self):
    t = 0.0
    count = 4
    xao = self.getXa(t)
    yao = self.getYa(t)
    xbo = self.getXb(t)
    ybo = self.getYb(t)
    xco = self.getX(t)
    yco = self.getY(t)
    plt.figure(figsize=(20, 8))
    w = 1
    while(self.getYa(t) >= 0.0):
      xa = self.getXa(t)
      ya = self.getYa(t)
      xb = self.getXb(t)
      yb = self.getYb(t)
      w = w + 1
      xc = self.getX(t)
      yc = self.getY(t)
      plt.plot([xao, xa], [yao, ya], '-or')
      plt.plot([xbo, xb], [ybo, yb], '-ob')
      plt.plot([xa, xb], [ya, yb], '-om')
      plt.plot([xco, xc], [yco, yc], '-ok')
      plt.draw()
      xao = xa
      yao = ya
      xbo = xb
      ybo = yb
      xco = xc
      yco = yc
      t += 0.02
      count += 1
      plt.legend(['M2', 'Mcom'], loc="upper right")

mybaton = Baton(0.5, 0.4, 15.0, 45.0, 2.5, 22.0)
mybaton.position()


